import React,{Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
constructor(){
  super();
  this.state={
    monster:[
      {name:'frankenstene',id:'1'},
      {name:'drakula',id:'2'},
      {name:'zombie',id:'3'}
    ]
  };
}
  render(){
  return (
    <div className="App">
    {this.state.monster.map(monster=>(<h1 key={monster.id}>{monster.name}</h1>))}
    </div>
  );
}
}
